import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faHtml5,
  faCss3,
  faJs,
  faNodeJs,
  faReact,
} from "@fortawesome/free-brands-svg-icons";
import tailwind from "../assets/tailwind1.svg";
import mongodb from "../assets/mongodb.png";
import express from "../assets/express.png";
import mysql from "../assets/mysql.png";

function Skills() {
  const logos = [
    { name: "html", icon: faHtml5, type: "awesomeFont" },
    { name: "css", icon: faCss3, type: "awesomeFont" },
    { name: "js", icon: faJs, type: "awesomeFont" },
    { name: "node", icon: faNodeJs, type: "awesomeFont" },
    { name: "react", icon: faReact, type: "awesomeFont" },
    { name: "tailwind", icon: tailwind, type: "awesomeFont" },
    { name: "mongodb", icon: mongodb, type: "awesomeFont" },
    { name: "ex", icon: express, type: "awesomeFont" },
    { name: "mysql", icon: mysql, type: "awesomeFont" },
  ];

  return (
    <div className="bg-white">
      <div className="flex justify-center text-darkTone text-5xl font-racing w-full p-10">
        Tech Stack
      </div>
      <div className="flex justify-evenly">
        {logos.map((item, index) => (
          <div key={index} className="border-2 border-lightTone p-5 rounded-xl">
            <FontAwesomeIcon size="5x" icon={item} />
          </div>
        ))}
      </div>
    </div>
  );
}

export default Skills;
